    "App.accessRule": {
        kind: "function",
        longname: "App.accessRule",
        memberof: "App",
        name: "accessRule",
        options: [
            {
                description:
                    "<p>Possible values:</p>\n<ul>\n<li><strong><code>'intent'</code></strong>: Controls which URLs the app is allowed to ask the system to open.\n(e.g. in the phone app or an email client).</li>\n<li><strong><code>'navigation'</code></strong>: Controls which URLs the WebView itself can be navigated to\n(can also needed for iframes).</li>\n<li><strong><code>'network'</code> or undefined</strong>: Controls which network requests (images, XHRs, etc) are allowed to be made.</li>\n</ul>",
                name: "type",
                type: {
                    names: ["String"]
                }
            },
            {
                description:
                    "<p>(Deprecated, use <code>type: 'intent'</code> instead.)</p>",
                name: "launchExternal",
                type: {
                    names: ["Boolean"]
                }
            }
        ],
        params: [
            {
                description:
                    "<p>The pattern defining affected domains or URLs.</p>",
                name: "pattern",
                type: {
                    names: ["String"]
                }
            },
            {
                name: "options",
                optional: true,
                type: {
                    names: ["Object"]
                }
            }
        ],
        scope: "static",
        summary:
            '<p>Set a new access rule based on origin domain for your app.\nBy default your application has a limited list of servers it can contact.\nUse this method to extend this list.</p>\n<p>Default access rules:</p>\n<ul>\n<li><code>tel:*</code>, <code>geo:*</code>, <code>mailto:*</code>, <code>sms:*</code>, <code>market:*</code> are allowed and\nare handled by the system (e.g. opened in the phone app or an email client)</li>\n<li><code>http://localhost:*</code> is used to serve the app\'s assets from.</li>\n<li>The domain or address of the Meteor server to connect to for DDP and\nhot code push of new versions.</li>\n</ul>\n<p>Read more about domain patterns in <a href="http://cordova.apache.org/docs/en/6.0.0/guide_appdev_whitelist_index.md.html">Cordova\ndocs</a>.</p>\n<p>Starting with Meteor 1.0.4 access rule for all domains and protocols\n(<code>&lt;access origin=&quot;*&quot;/&gt;</code>) is no longer set by default due to\n<a href="http://cordova.apache.org/announcements/2014/08/04/android-351.html">certain kind of possible\nattacks</a>.</p>'
    },
