                description:
                    '<p>A dictionary where keys are different\ndevices, screen sizes, and orientations, and the values are image paths\nrelative to the project root directory.</p>\n<p>For Android, launch screen images should\nbe special &quot;Nine-patch&quot; image files that specify how they should be\nstretched. See the <a href="https://developer.android.com/guide/topics/graphics/2d-graphics.html#nine-patch">Android docs</a>.</p>\n<p>Valid key values:</p>\n<ul>\n<li><code>iphone5</code> (640x1136) // iPhone 5, SE</li>\n<li><code>iphone6</code> (750x1334) // iPhone 6, 6s, 7, 8</li>\n<li><code>iphone6p_portrait</code> (1242x2208) // iPhone 6 Plus, 6s Plus, 7 Plus, 8 Plus</li>\n<li><code>iphone6p_landscape</code> (2208x1242) // iPhone 6 Plus, 6s Plus, 7 Plus, 8 Plus</li>\n<li><code>iphoneX_portrait</code> (1125x2436) // iPhone X</li>\n<li><code>iphoneX_landscape</code> (2436x1125) // iPhone X</li>\n<li><code>ipad_portrait_2x</code> (1536x2048) // iPad, iPad mini</li>\n<li><code>ipad_landscape_2x</code> (2048x1536) // iPad, iPad mini</li>\n<li><code>ipad_portrait_pro_10_5</code> (1668x2224) // iPad Pro 10.5&quot;</li>\n<li><code>ipad_landscape_pro_10_5</code> (2224x1668) // iPad Pro 10.5&quot;</li>\n<li><code>ipad_portrait_pro_12_9</code> (2048x2732) // iPad Pro 12.9&quot;</li>\n<li><code>ipad_landscape_pro_12_9</code> (2732x2048) // iPad Pro 12.9&quot;</li>\n<li><code>iphone_2x</code> (640x960) // Legacy</li>\n<li><code>ipad_portrait</code> (768x1024) // Legacy</li>\n<li><code>ipad_landscape</code> (1024x768) // Legacy</li>\n<li><code>android_mdpi_portrait</code> (320x480)</li>\n<li><code>android_mdpi_landscape</code> (480x320)</li>\n<li><code>android_hdpi_portrait</code> (480x800)</li>\n<li><code>android_hdpi_landscape</code> (800x480)</li>\n<li><code>android_xhdpi_portrait</code> (720x1280)</li>\n<li><code>android_xhdpi_landscape</code> (1280x720)</li>\n<li><code>android_xxhdpi_portrait</code> (960x1600)</li>\n<li><code>android_xxhdpi_landscape</code> (1600x960)</li>\n<li><code>android_xxxhdpi_portrait</code> (1280x1920)</li>\n<li><code>android_xxxhdpi_landscape</code> (1920x1280)</li>\n</ul>',
