    "PackageAPI#use": {
        kind: "function",
        locus: "package.js",
        longname: "PackageAPI#use",
        memberof: "PackageAPI",
        name: "use",
        options: [
            {
                description:
                    "<p>Establish a weak dependency on a\npackage. If package A has a weak dependency on package B, it means\nthat including A in an app does not force B to be included too — but,\nif B is included or by another package, then B will load before A.\nYou can use this to make packages that optionally integrate with or\nenhance other packages if those packages are present.\nWhen you weakly depend on a package you don't see its exports.\nYou can detect if the possibly-present weakly-depended-on package\nis there by seeing if <code>Package.foo</code> exists, and get its exports\nfrom the same place.</p>",
                name: "weak",
                type: {
                    names: ["Boolean"]
                }
            },
            {
                description:
                    "<p>It's okay to load this dependency\nafter your package. (In general, dependencies specified by <code>api.use</code>\nare loaded before your package.) You can use this option to break\ncircular dependencies.</p>",
                name: "unordered",
                type: {
                    names: ["Boolean"]
                }
            }
        ],
        params: [
            {
                description:
                    "<p>Packages being depended on.\nPackage names may be suffixed with an @version tag.</p>\n<p>In general, you must specify a package's version (e.g.,\n<a href=\"mailto:`'accounts@1.0.0\">`'accounts@1.0.0</a>'<code>to use version 1.0.0 or a higher\ncompatible version (ex: 1.0.1, 1.5.0, etc.)  of the</code>accounts<code>package). If you are sourcing core\npackages from a Meteor release with</code>versionsFrom<code>, you may leave\noff version names for core packages. You may also specify constraints,\nsuch as</code>my:forms@=1.0.0<code>(this package demands</code>my:forms<code>at</code>1.0.0<code>exactly),\nor</code>my:<a href=\"mailto:forms@1.0.0\">forms@1.0.0</a> || =2.0.1<code>(</code>my:forms<code>at</code>1.x.y<code>, or exactly</code>2.0.1`).</p>",
                name: "packageNames",
                type: {
                    names: ["String", "Array.<String>"]
                }
            },
            {
                description:
                    "<p>If you only use the package on the\nserver (or the client), you can pass in the second argument (e.g.,\n<code>'server'</code>, <code>'client'</code>, <code>'web.browser'</code>, <code>'web.cordova'</code>) to specify\nwhat architecture the package is used with. You can specify multiple\narchitectures by passing in an array, for example <code>['web.cordova', 'os.linux']</code>.</p>",
                name: "architecture",
                optional: true,
                type: {
                    names: ["String", "Array.<String>"]
                }
            },
            {
                name: "options",
                optional: true,
                type: {
                    names: ["Object"]
                }
            }
        ],
        scope: "instance",
        summary: "<p>Depend on package <code>packagename</code>.</p>"
    },
    "PackageAPI#versionsFrom": {
        kind: "function",
        locus: "package.js",
        longname: "PackageAPI#versionsFrom",
        memberof: "PackageAPI",
        name: "versionsFrom",
        options: [],
        params: [
            {
                description:
                    "<p>Specification of a release:\ntrack@version. Just 'version' (e.g. <code>&quot;0.9.0&quot;</code>) is sufficient if using the\ndefault release track <code>METEOR</code>. Can be an array of specifications.</p>",
                name: "meteorRelease",
                type: {
                    names: ["String", "Array.<String>"]
                }
            }
        ],
        scope: "instance",
        summary:
            "<p>Use versions of core packages from a release. Unless provided,\nall packages will default to the versions released along with\n<code>meteorRelease</code>. This will save you from having to figure out the exact\nversions of the core packages you want to use. For example, if the newest\nrelease of meteor is <a href=\"mailto:`METEOR@0.9.0\">`METEOR@0.9.0</a><code>and it includes</code><a href=\"mailto:jquery@1.0.0\">jquery@1.0.0</a><code>, you\ncan write</code>api.versionsFrom(<a href=\"mailto:'METEOR@0.9.0\">'METEOR@0.9.0</a>')<code>in your package, and when you\nlater write</code>api.use('jquery')<code>, it will be equivalent to</code>api.use(<a href=\"mailto:'jquery@1.0.0\">'jquery@1.0.0</a>')<code>. You may specify an array of multiple releases,\nin which case the default value for constraints will be the &quot;or&quot; of the\nversions from each release:</code>api.versionsFrom([<a href=\"mailto:'METEOR@0.9.0\">'METEOR@0.9.0</a>',\n<a href=\"mailto:'METEOR@0.9.5\">'METEOR@0.9.5</a>'])<code>may cause</code>api.use('jquery')<code>to be interpreted as</code>api.use(<a href=\"mailto:'jquery@1.0.0\">'jquery@1.0.0</a> || 2.0.0')`.</p>"
    },
