        scope: "instance",
        summary:
            '<p>Specify which <a href="http://cordova.apache.org/">Cordova / PhoneGap</a>\nplugins your Meteor package depends on.</p>\n<p>Plugins are installed from\n<a href="http://plugins.cordova.io/">plugins.cordova.io</a>, so the plugins and\nversions specified must exist there. Alternatively, the version\ncan be replaced with a GitHub tarball URL as described in the\n<a href="https://guide.meteor.com/mobile.html#cordova-plugins">Cordova</a>\npage of the Meteor wiki on GitHub.</p>'
